I Have a Wife - Selena Castro

Actors: Selena Castro, Jerry

Release Date: November 17, 2010

Who: Wife's Employee,

Where: Couch, Living room,

Selena Castro is cleaning up her make-up kit when her client's husband comes in looking for his wife. Selena has to tell him that his wife already left without saying a word. He's sick and tired of her always leaving him high and dry so he turns to Selena in his time of need...to help him get his rocks off!
